    @Test
    public void exportWordTest() {
        String s1 = "";
        //String s2 = "";
        String s2 = "";
        Map<String, Object> map = Maps.newHashMap();
        List<Person> personList = Lists.newArrayList();
        personList.add(Person.builder().name("张永名").age(27).image(s1).build());
        personList.add(Person.builder().name("呵呵哒").age(29).image(s2).build());

        map.put("personList", personList);

        Configuration configuration = new Configuration(Configuration.getVersion());
        configuration.setDefaultEncoding("utf-8");
        configuration.setClassForTemplateLoading(this.getClass(), "/template");

        try (FileOutputStream fos = new FileOutputStream("D:/zhang.doc");
             Writer writer = new OutputStreamWriter(fos);) {
            Template t = configuration.getTemplate("template.ftl");
            t.process(map, writer);
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

